import React, { createContext } from "react";
import all_prodcut from '../Components/Assets/all_product';
export const ShopCotext = createContext(null);

const ShopContextProvider = (props) => {

    const contextValue = {all_prodcut};
    return(
        <ShopContextProvider value = {contextValue}>
            {props.children}
        </ShopContextProvider>
    )
}

export default ShopContextProvider;
